hwMeta.bodyText:
Switch(rSt)\
    .Case(rSt_t.rdIdle,
        If((bus_ar_valid & ~isBramAddr & ~w_hs)._eq(1),
            rSt_next(rSt_t.rdData)
        ).Elif((bus_ar_valid & isBramAddr & ~w_hs)._eq(1),
            rSt_next(rSt_t.bramRd)
        ).Else(
            rSt_next(rSt)
        ))\
    .Case(rSt_t.bramRd,
        If((~w_hs)._eq(1),
            rSt_next(rSt_t.rdData)
        ).Else(
            rSt_next(rSt)
        ))\
    .Default(
        If(bus_r_ready._eq(1),
            rSt_next(rSt_t.rdIdle)
        ).Else(
            rSt_next(rSt)
        ))

If(clk._onRisingEdge(),
    If(rst_n._eq(0),
        wSt(wSt_t.wrIdle),
        rSt(rSt_t.rdIdle)
    ).Else(
        wSt(wSt_next),
        rSt(rSt_next)
    )
)

Switch(wSt)\
    .Case(wSt_t.wrIdle,
        If(bus_aw_valid._eq(1),
            wSt_next(wSt_t.wrData)
        ).Else(
            wSt_next(wSt)
        ))\
    .Case(wSt_t.wrData,
        If(bus_w_valid._eq(1),
            wSt_next(wSt_t.wrResp)
        ).Else(
            wSt_next(wSt)
        ))\
    .Default(
        If(bus_b_ready._eq(1),
            wSt_next(wSt_t.wrIdle)
        ).Else(
            wSt_next(wSt)
        ))

Switch(st)\
    .Case(state_t.ready,
        If(reg_cmd_vld._eq(1) & reg_cmd._eq(1),
            st_next(state_t.wait_aw)
        ).Elif(reg_cmd_vld._eq(1) & reg_cmd._eq(4),
            st_next(state_t.wait_ar)
        ).Elif(reg_cmd_vld._eq(1) & reg_cmd._eq(2),
            st_next(state_t.wait_w)
        ).Elif(reg_cmd_vld._eq(1) & reg_cmd._eq(5),
            st_next(state_t.wait_r)
        ).Elif(reg_cmd_vld._eq(1) & reg_cmd._eq(3),
            st_next(state_t.wait_b)
        ).Else(
            st_next(st)
        ))\
    .Case(state_t.wait_aw,
        If(m_axi_aw_ready._eq(1),
            st_next(state_t.ready)
        ).Else(
            st_next(st)
        ))\
    .Case(state_t.wait_ar,
        If(m_axi_ar_ready._eq(1),
            st_next(state_t.ready)
        ).Else(
            st_next(st)
        ))\
    .Case(state_t.wait_w,
        If(m_axi_w_ready._eq(1),
            st_next(state_t.ready)
        ).Else(
            st_next(st)
        ))\
    .Case(state_t.wait_r,
        If(m_axi_r_valid._eq(1),
            st_next(state_t.ready)
        ).Else(
            st_next(st)
        ))\
    .Default(
        If(m_axi_b_valid._eq(1),
            st_next(state_t.ready)
        ).Else(
            st_next(st)
        ))
